import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Bedrooms from './screens/Bedrooms';

function App() {
  const houseId = 2; // Replace "yourHouseId" with the actual houseId value

  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>
        <Routes>
          <Route
            path="casa-izvorul-raraului/bedrooms"
            element={<Bedrooms houseId={houseId} />}
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
